script: |
  super -f text -I q4352.spq | sort > q4352.out

inputs:
  - name: q4352.spq
    data: |
      SELECT DISTINCT - ( - 70 ) FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab1
  - name: tab2

outputs:
  - name: q4352.out
    data: |
      70
